import React from "react"
import Titels from "./Components/Title"
import Form from "./Components/Form"
import Weather from "./Components/Weather"



class App extends React.Component{
    render(){
        return(
            <div>
                <Titels />
                <Form />
                <Weather />
            </div>
        );
    }
}

export default App;
